import React from "react";
import {
  Button,
  Container,
  Dropdown,
  Image,
  Menu,
  Input,
  Icon,
  Label,
} from "semantic-ui-react";

const searchstyle = {
  width: "200px",
};

export default function LoginScreen() {
  return (
    <div>
      <Menu inverted fixed="top" size="massive">
        <Container>
          <Menu.Item></Menu.Item>
          <Menu.Item>
            <Image src="images/naxus12.PNG" size="small" />
          </Menu.Item>

          <Menu.Menu position="right">
            <Menu.Item className="d-flex justify-content-end">
              <Input
                size="huge"
                className="icon"
                icon="search"
                placeholder="Searching?"
              />
            </Menu.Item>
            <Menu.Item>
              <Button backgroundcolor="grey" inverted color="black">
                <Icon name="shopping cart" />
                Sepetim
              </Button>
            </Menu.Item>
            <Menu.Item>
              <Dropdown icon="user outline"  item  text="HesabÄ±m">
                <Dropdown.Menu>
                  <Dropdown.Item>
                    <Button primary  size="small">Login<Icon name='sign in' /></Button>
                  </Dropdown.Item>
                  <Dropdown.Item>
                    <Button primary size="small">Sign-up <Icon name='signup' /> </Button>
                  </Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
            </Menu.Item>
          </Menu.Menu>
        </Container>
      </Menu>
    </div>

    // <div style={divstyle}>
    //   <Menu inverted fixed="top">
    //     <Container>
    //       <Menu.Item name="editorials">Editorials</Menu.Item>
    //       <Menu.Item name="reviews">Reviews</Menu.Item>
    //       <Menu.Item name="upcomingEvents">Upcoming Events</Menu.Item>
    //       </Container>
    //   </Menu>
    // </div>
  );
}
